import {useEffect, useState} from "react";
import axios from "axios";

function App() {
    const [advertisements, setAdvertisements] = useState([]);

    useEffect(() => {
        // Fetch the list of advertisements from the backend API
        axios.get('http://localhost:8080/apartments', //proxy uri
            {
                headers: {
                    method:"POST",
                    mode: 'no-cors',
                    headers:{
                        "Content-Type": "application/json",
                        "Access-Control-Allow-Origin": process.env.REACT_APP_API_URL,
                        "Access-Control-Request-Headers": 'Content-Type, Authorization',
                }}}) // Change the API endpoint accordingly for other categories
            .then((response) => {
                console.log(JSON.stringify(response))
                setAdvertisements(response.data);
            })
            .catch((error) => {
                console.error('Error fetching advertisements:', error);
            });
    }, []);

    return (
        <div>
            <h2>Advertisement List</h2>
            {advertisements.length === 0 ? (
                <p>No advertisements found.</p>
            ) : (
                <ul>
                    {advertisements.map((ad) => (
                        <li key={ad.id}>
                            {/* Display the advertisement details here */}
                            <p>Type: {ad.type}</p>
                            {/* Display other advertisement fields */}
                        </li>
                    ))}
                </ul>
            )}
        </div>
    );
}

export default App;
